schema:
{
  // Products Collection
  “products”: {
    _id: ObjectId,
    name: String,
    description: String,
    price: Decimal128,
    category: String,
    stockQuantity: Number,
    isActive: Boolean,
    createdAt: Date,
    updatedAt: Date
  },

  // Orders Collection
  “orders”: {
    _id: ObjectId,
    customerId: String,
    items: [{
      productId: ObjectId,
      quantity: Number,
      price: Decimal128
    }],
    totalAmount: Decimal128,
    status: String,
    paymentMethod: String,
    shippingAddress: {
      street: String,
      city: String,
      state: String,
      zipCode: String,
      country: String
    },
    orderDate: Date,
    lastUpdated: Date
  }
}
